import {  Col,Container,Row } from 'react-bootstrap';
import '../new.css';
import ProjectCard from "./ProjectCard";
import firstimage from "/images/ensemble.png"

function Projects() {
    return (
        <Container fluid className="home-section" id="home">
        <Container className="home-content">
        <Row>
        <Col md={7} >
            
            <h1 style={{ fontSize: "2.6em" }} >
              My recent  <strong className="bleu"> Works </strong>
            </h1 >
            <p style={{ color: "black" ,fontSize: "1.3em" } }  >
          Here are a few projects I've worked on recently.
        </p>
        </Col>
        </Row>
        <Row>
        <Col md={4} className="project-card">
        <ProjectCard
              isBlog={false}
              imgPath={firstimage}
              title="E-commerce website"
              
              description="Tools :" 
              ghLink="https://github.com/ilhem22/E-commerce-fronted-website"
              ghdemo="https://e-commerce-w.onrender.com/"
            />
          </Col>
          </Row>
        </Container>
        </Container>

            );
            }
            
 export default Projects;
